INSERT INTO `montaje_cronograma` VALUES (4, 6, 'Transporte de materiales e ingreso a obra', 'Se realizo el traslado, recepción y acarreo de materiales a la zona designada por el cliente de 8:00 am a 12:30 pm\nCharla de inducción.', '2020-06-23', '2020-06-23', 1, 1, 1, 6, 10, '2020-07-17 14:57:15', '2020-07-22 09:20:57');
INSERT INTO `montaje_cronograma` VALUES (5, 6, 'Trazo y replanteo', 'Reconocimiento de la zona de trabajo, Trazo de ejes y coordinación de montaje con el cliente.\nMedición y corte de las columnas y su traslado a la ubicación respectiva.', '2020-06-23', '2020-06-24', 2, 1, 1, 6, 10, '2020-07-17 14:59:16', '2020-07-22 09:20:59');
INSERT INTO `montaje_cronograma` VALUES (6, 6, 'Montaje de estructura y termomuro', 'Instalación de las columnas por soldeo y verificacion de niveles y medidas para el corte del termomuro.\nInstalación del termomuro y canaletas fijados al piso, techo y columnas', '2020-06-25', '2020-06-27', 3, 1, 1, 6, 10, '2020-07-17 15:33:37', '2020-07-22 09:21:01');
INSERT INTO `montaje_cronograma` VALUES (7, 6, 'Instalación de Puertas', 'Instalación de las dos puertas de acceso\nInstalación de brazos hidráulicos', '2020-06-29', '2020-06-30', 4, 1, 1, 6, 10, '2020-07-17 15:35:05', '2020-07-22 09:21:04');
INSERT INTO `montaje_cronograma` VALUES (8, 6, 'Instalación Zócalo y Policarbonato', 'Instalación de policarbonato a las puertas de acceso.\nInstalación de zócalo sanitario parte externa de la cobertura', '2020-07-01', '2020-07-01', 5, 1, 1, 6, 10, '2020-07-17 15:36:53', '2020-07-22 09:21:06');
INSERT INTO `montaje_cronograma` VALUES (9, 6, 'Resanes y Acabados', 'Remate de pintura, sellado con sikaflex, sika boom.\nLimpieza de la cobertura. \nTarrajeo, \nRecojo de equipos y herramientas.', '2020-07-02', '2020-07-03', 6, 1, 1, 6, 10, '2020-07-17 16:32:00', '2020-07-22 09:21:09');
